void DigitRec::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"array4_address0\" :  \"" << array4_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"array4_ce0\" :  \"" << array4_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"array4_q0\" :  \"" << array4_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"global_results_address0\" :  \"" << global_results_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"global_results_ce0\" :  \"" << global_results_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"global_results_we0\" :  \"" << global_results_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"global_results_d0\" :  \"" << global_results_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"num_training\" :  \"" << num_training.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"num_test\" :  \"" << num_test.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

